import React, { useState } from "react";
import jsPDF from "jspdf";
import "../styles.css";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    customerName: "",
    jobAddress: "",
    claimNumber: "",
    lossType: "Water Damage",
    startDate: "",
    endDate: "",
    moistureTable: [{ room: "", reading: "" }],
    equipmentUsed: "",
    laborHours: "",
    estimatedCost: "",
    notes: "",
    paymentStatus: "Pending",
    clientSignature: "",
    technicianSignature: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleTableChange = (index, field, value) => {
    const updatedTable = [...formData.moistureTable];
    updatedTable[index][field] = value;
    setFormData({ ...formData, moistureTable: updatedTable });
  };

  const addRow = () => {
    setFormData({
      ...formData,
      moistureTable: [...formData.moistureTable, { room: "", reading: "" }],
    });
  };

  // INSURANCE PDF FORMAT
  const generatePDF = () => {
    const doc = new jsPDF();
    doc.text("üè¢ TOOLBELTAI ‚Äì MITIGATION INSURANCE REPORT", 10, 10);
    doc.line(10, 12, 200, 12);

    doc.text(`üìÖ Start Date: ${formData.startDate}`, 10, 25);
    doc.text(`üìÖ End Date: ${formData.endDate}`, 10, 35);
    doc.text(`üìÅ Claim #: ${formData.claimNumber}`, 10, 45);
    doc.text(`üî• Loss Type: ${formData.lossType}`, 10, 55);

    doc.text(`üè† Location: ${formData.jobAddress}`, 10, 70);
    doc.text(`üë§ Customer: ${formData.customerName}`, 10, 80);

    doc.text("üìä Moisture Readings:", 10, 95);
    formData.moistureTable.forEach((row, i) => {
      doc.text(`${row.room || "‚Äî"}: ${row.reading || "‚Äî"}`, 10, 105 + i * 10);
    });

    doc.text(`üõ† Equipment Used: ${formData.equipmentUsed}`, 10, 150);
    doc.text(`‚è± Labor Hours: ${formData.laborHours}`, 10, 160);
    doc.text(`üíµ Estimated Cost: $${formData.estimatedCost}`, 10, 170);

    doc.text("üìå Notes:", 10, 185);
    doc.text(formData.notes || "N/A", 10, 195);

    doc.text("üñä Technician Signature:", 10, 220);
    doc.text(formData.technicianSignature || "____________________", 70, 220);

    doc.text("üñä Client Signature:", 10, 230);
    doc.text(formData.clientSignature || "____________________", 70, 230);

    doc.save("insurance_report.pdf");
  };

  return (
    <div className="mitigation-form-container">
      <div className="card form-section">
        <h2>Insurance Mitigation Form</h2>

        <input name="customerName" placeholder="Customer Name" onChange={handleChange} />
        <input name="jobAddress" placeholder="Job Address" onChange={handleChange} />
        <input name="claimNumber" placeholder="Claim Number" onChange={handleChange} />

        <select name="lossType" onChange={handleChange}>
          <option>Water Damage</option>
          <option>Fire Damage</option>
          <option>Mold</option>
          <option>Storm</option>
        </select>

        <label>Start Date:</label>
        <input name="startDate" type="date" onChange={handleChange} />

        <label>End Date:</label>
        <input name="endDate" type="date" onChange={handleChange} />

        <h3>Moisture Readings</h3>
        {formData.moistureTable.map((row, index) => (
          <div key={index} className="table-row">
            <input
              placeholder="Room"
              value={row.room}
              onChange={(e) => handleTableChange(index, "room", e.target.value)}
            />
            <input
              placeholder="Reading %"
              value={row.reading}
              onChange={(e) => handleTableChange(index, "reading", e.target.value)}
            />
          </div>
        ))}
        <button className="add-row-btn" onClick={addRow}>‚ûï Add Room</button>

        <textarea name="equipmentUsed" placeholder="Equipment Used" onChange={handleChange} />
        <input name="laborHours" placeholder="Labor Hours" onChange={handleChange} />
        <input name="estimatedCost" placeholder="Estimated Cost" onChange={handleChange} />

        <textarea name="notes" placeholder="Job Notes" onChange={handleChange} />

        <input name="technicianSignature" placeholder="Technician Signature" onChange={handleChange} />
        <input name="clientSignature" placeholder="Client Signature" onChange={handleChange} />

        <button className="pdf-btn" onClick={generatePDF}>üìÑ Download Insurance PDF</button>
      </div>
    </div>
  );
};

export default MitigationForm;
